import React, { useState } from 'react';
import Axios from 'axios'; // API 
import './UserRegistration.css';


function UserRegistration() {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [DOB, setDOB] = useState('');

    const register = () => {
        Axios.post('http://localhost:8080/api/v1/users', {
            firstName: firstName,
            lastName: lastName,
            email: email,
            DOB: DOB
        }).then((response) => {
            console.log(response.data);
        }).catch((err) => {
            console.log("Promise Rejected", err.response.data);
        })
    }

    const handleFirstNameChange = e => { 
        setFirstName(e.target.value)
    }

    const handleLastNameChange = e => {
        setLastName(e.target.value)
    }

    const handleEmailChange = e => {
        setEmail(e.target.value);
    }

    const handleDOBChange = e => {
        setDOB(e.target.value);
    }

    return (
        <div className="userRegistration">

            <div className="container">
                <input type="text" placeholder="firstName" value={firstName} onChange={handleFirstNameChange}></input>
                <h6>First name: {firstName}</h6>
            </div>
            <div className="container">
                <input type="text" placeholder="lastName" value={lastName} onChange={handleLastNameChange}></input>
                <h6>Last name: {lastName}</h6>
            </div>
            <div className="container">
                <input type="text" placeholder="email" value={email} onChange={handleEmailChange}></input>
                <h6>Last name: {email}</h6>
            </div>
            <div className="container">
                <input type="text" placeholder="Date-Of-Birth" value={DOB} onChange={handleDOBChange}></input>
                <h6>Last name: {DOB}</h6>
            </div>


            <div className="container">
                <button onClick={register}>Reigster</button>
            </div>
        </div>
    )
}

export default UserRegistration;
